column1787:
24/Jun/25 5:17 PM;Niket.Bagwe;Currently the command used by the sstableloader is as follows
{code:java}
sstableloader <table dir> -d 10.14.20.248 -i 10.14.20.249 -cph 1 -idct 0 -p 9042 -ssp 7001 -sp 7000 -f /etc/dse/cassandra/cassandra.yaml -u "cassandra" -pw cassandra {code}
Here ssp and sp options refer to ssl_storage_port and storage_port repectively, the first one is used for encrypted and the later is used for unencrypted communication.

As per [Dse 6.9.9 documentation|https://docs.datastax.com/en/dse/6.9/securing/internode-transitional-mode.html], ssl_storage_port has been deprecated in DSE 6.9.7. The usual storage port should handle both encrypted and unencrypted communication. There is a field introduced in cassandra.yaml enable_legacy_ssl_storage_port (Refer [this|https://github.com/datastax/release-notes/blob/dse-6.9.10-release/DSE_6.9_Release_Notes.md)] which allows the user to set transitional mode that allows the user to activate both ssl_storage_port and storage_port for DSE 6.9.7 installations. The transitional mode is bydefault disabled i.e. both  encrypted and unencrypted communication happens via storage_port itself. 
When enable_legacy_ssl_storage_port is set to true, sstableloader works as expected.
When enable_legacy_ssl_storage_port is set to false (default value), ideally the sstableloader should automatically send encrypted/unencrypted communication on  storage_port, instead sstableloader sends encrypted communication on ssl_storage_port (7001 which is deprecated). This causes sstableloader to fail. This looks like a bug which is discussed [here|[https://issues.apache.org/jira/browse/CASSANDRA-17602?focusedCommentId=17536621&page=com.atlassian.jira.plugin.system.issuetabpanels%3Acomment-tabpanel#comment-17536621].]  Probably this fix has node made to DSE releases yet. The workaround for this problem is to set ssl_storage_port to 7000 in the sstableloader command so that the sstableoader contacts 7000 which is the unifield port, instead of contacting 7001.

Note that a similar field is available in apache cassandra [legacy_ssl_storage_port_enabled|https://github.com/apache/cassandra/blob/cassandra-5.0/conf/cassandra.yaml#L1626]and here the sstableloader works as expected with both combinations viz legacy_ssl_storage_port_enabled enabled and disabled.

 ;;;

