13/Jun/25 12:17 AM;amol.mishra;Further investigation revealed that, issue came because we have socks proxy disabled. So far all the workflows and automation runs we did, happened with Socks proxy enabled, which has a different fallback mechanism to reinitialize the client. 

But seemingly on this cluster, we have service identity disabled. Hence this happened. global_identity key is missing.
{code:java}
service_identity {
  have_all_nodes_upgraded_to_supported_release: true
} {code}
Is this something expected on the below platform [~sachithananthan.kesavan] [~aniket.goyal] ??
{code:java}
[cohesity@cloud-art-jishnu-42010a660187-node-1 ~]$ product_name.sh
Cohesity in GCP NextGen
[cohesity@cloud-art-jishnu-42010a660187-node-1 ~]$ {code}
